  static String toStringValue(Align e) {
    switch (e) {
      case Align.left:
        return 'left';
      case Align.right:
        return 'right';

      default:
        return null;
    }
  }

  static Align fromStringValue(String s) {
    if (s == 'left') {
      return Align.left;
    }
    if (s == 'right') {
      return Align.right;
    }
    return null;
  }
}

