  static String toStringValue(PermissionType e) {
    switch (e) {
      case PermissionType.view:
        return 'view';
      case PermissionType.edit:
        return 'edit';

      default:
        return null;
    }
  }

  static PermissionType fromStringValue(String s) {
    if (s == 'view') {
      return PermissionType.view;
    }
    if (s == 'edit') {
      return PermissionType.edit;
    }
    return null;
  }
}

